window.bookSummaryJSON = "<p>Bloomsbury presents The Assassin's Blade by Sarah J. Maas, read by Elizabeth Evans.<br> <br> The twist of a knife. The birth of a legend.<br> <br> Step into the world of the #1 bestselling Throne of Glass series by Sarah J. Maas with this collection of prequel novellas.<br> <br> Celaena Sardothien is her kingdom’s most feared assassin. Though she works for the powerful Assassin’s Guild and its scheming master, Arobynn Hamel, she yields to no one and trusts only her fellow killer-for-hire, Sam. But when Arobynn dispatches her on missions that take her from remote islands to hostile deserts, Celaena finds herself acting independently of his wishes and questioning her own allegiance. <br> <br> If she hopes to escape Arobynn’s clutches, Celaena will have to put her faith in her wits and her blade . . . knowing that if she fails, she’ll lose not just a chance at freedom but her life.<br> <br> A prequel to the New York Times bestselling Throne of Glass, this collection of five novellas explores the history of this cunning assassin and her enthralling—and deadly—world.<br> <br> Included in this volume: <br> The Assassin and the Pirate Lord<br> The Assassin and the Healer<br> The Assassin and the Desert<br> The Assassin and the Underworld<br> The Assassin and the Empire</p>"; 
